import React from 'react';
import './YouTubeVideoList.css';

import YouTubeVideo from '../YouTubeVideo/YouTubeVideo';

class YouTubeVideoList extends React.Component {
  render() {
    return (
    	/*
    	<div className="video_list" id={this.props.title}>
    		<h1 className="list_title">{this.props.title}</h1>
    		{
	          this.props.videos_list.map(video => {
	            return <YouTubeVideo link={video.link} id={video.id} title={video.title} />
	          })
	        }
    	</div>
    	*/

    	<div className="video_list">
    		<h1 className="list_title">All Videos</h1>
    		{
    			this.props.videoList.map(video => {
    				return <YouTubeVideo link={video.link} id={video.id} title={video.title} />
    			})
    		}
    	</div>

    	/*<div className="video_list">
    		{this.props.videoList.map(video => <p>{video.title}</p>)}
    		<h1 className="list_title">Video Title</h1>
    		<YouTubeVideo />
    		<YouTubeVideo />
    		<YouTubeVideo />
    		<YouTubeVideo />
    		<YouTubeVideo />
    		<YouTubeVideo />
    		<YouTubeVideo />
    		<YouTubeVideo />
    		<YouTubeVideo />
    		<YouTubeVideo />
    		<YouTubeVideo />
    	</div>
    	*/
    );
  }
}

export default YouTubeVideoList;
